import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Home from './pages/Home_page/Home';
import Products from './pages/Products_page/Products';
import About from './pages/About_page/About';
import Signup from './pages/SignUp_page/Signup_pg';
import Login from './pages/Login_page/Login_pg';
import Staff from './pages/Staff_page/Staff';
import Retail_main from './pages/Retail_page/Retail_main';
import rt_cart from './pages/Retail_page/Rt_cart';


export default function App() {
  return (

    <>
    <Router>

    <Routes>
      <Route path='/' element={<Home/>}/>
      <Route path='/products' element={<Products/>}/>
      <Route path='/about_us' element={<About/>}/>
      <Route path='/signup' element={<Signup/>}/>
      <Route path='/login' element={<Login/>}/>
      <Route path='/staff' element={<Staff/>}/>
      <Route path='/retail_seller' element={<Retail_main/>}/>
      <Route path='/cart' element={<rt_cart/>}/>
    </Routes>
    </Router>
    </>
  )

}
